CREATE TABLE COORDENADOR ( 
ID_COORDENADOR INT, 
NOME_COORDENADOR VARCHAR(150), 
PRIMARY KEY (ID_COORDENADOR) 
); 

CREATE TABLE CURSO ( 
ID_CURSO INT, 
NOME_CURSO VARCHAR(150), 
SITUACAO_CURSO VARCHAR(100), 
NIVEL_ENSINO VARCHAR(100), 
MODALIDADE_EDUCACAO VARCHAR(100), 
PRIMARY KEY (ID_CURSO) 
); 

CREATE TABLE OFERTA ( 
ID_CURSO INT, 
GRAU_ACADEMICO VARCHAR(100), 
AREA_CONHECIMENTO VARCHAR(150), 
TIPO_OFERTA VARCHAR(100), 
TIPO_CICLO_FORMACAO VARCHAR(100), 
DATA_FUNCIONAMENTO VARCHAR(100), 
FOREIGN KEY (ID_CURSO) REFERENCES CURSO(ID_CURSO), 
PRIMARY KEY (ID_CURSO) 
); 

CREATE TABLE TURNO ( 
ID_TURNO INT, 
NOME_TURNO VARCHAR(100),  
PRIMARY KEY (ID_TURNO) 
); 

CREATE TABLE CURSO_TURNO ( 
ID_CURSO INT, 
ID_TURNO INT,
FOREIGN KEY (ID_CURSO) REFERENCES CURSO(ID_CURSO), 
FOREIGN KEY (ID_TURNO) REFERENCES TURNO(ID_TURNO),
PRIMARY KEY (ID_CURSO, ID_TURNO)
); 




CREATE TABLE UNIDADE_ACADEMICA ( 
ID_UNIDADE_RESPONSAVEL INT, 
UNIDADE_RESPONSAVEL VARCHAR(150),  
PRIMARY KEY (ID_UNIDADE_RESPONSAVEL) 
); 


CREATE TABLE LOCALIZACAO ( 
ID_CURSO INT, 
MUNICIPIO VARCHAR(100),  
CAMPUS VARCHAR(100),  
FOREIGN KEY (ID_CURSO) REFERENCES CURSO(ID_CURSO), 
PRIMARY KEY (ID_CURSO) 
); 


CREATE TABLE COORDENADOR_UNIDADE ( 
ID_COORDENADOR INT, 
ID_UNIDADE_RESPONSAVEL INT, 
FOREIGN KEY (ID_COORDENADOR) REFERENCES COORDENADOR(ID_COORDENADOR), 
FOREIGN KEY (ID_UNIDADE_RESPONSAVEL) REFERENCES UNIDADE_ACADEMICA(ID_UNIDADE_RESPONSAVEL), 
PRIMARY KEY (ID_COORDENADOR,ID_UNIDADE_RESPONSAVEL) 
); 


CREATE TABLE CURSO_UNIDADE ( 
ID_CURSO INT, 
ID_UNIDADE_RESPONSAVEL INT, 
FOREIGN KEY (ID_CURSO) REFERENCES CURSO(ID_CURSO), 
FOREIGN KEY (ID_UNIDADE_RESPONSAVEL) REFERENCES UNIDADE_ACADEMICA(ID_UNIDADE_RESPONSAVEL), 
PRIMARY KEY (ID_CURSO,ID_UNIDADE_RESPONSAVEL) 
); 


CREATE TABLE MEC ( 
COD_INEP INT, 
DOU VARCHAR(100), 
PORTARIA_RECONHECIMENTO VARCHAR(150), 
PRIMARY KEY (COD_INEP) 
); 


CREATE TABLE CURSO_MEC ( 
ID_CURSO INT, 
COD_INEP INT, 
FOREIGN KEY (ID_CURSO) REFERENCES CURSO(ID_CURSO), 
FOREIGN KEY (COD_INEP) REFERENCES MEC(COD_INEP), 
PRIMARY KEY (ID_CURSO,COD_INEP) 
); 

































